import React from "react";
import { Container, Text, PrimaryButton } from "../../styledComponents";
import styled from "styled-components";

const SearchWrapper = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  justify-content: "space-between";
  padding-right: 110px;
  padding-top: 30px;
  padding-bottom: 30px;
  padding-left: 110px;
  background-color: white;
`;
const Houses = () => {
  return (
    <Container flex={1} color="blue">
      <SearchWrapper>
        <Container>
          <Text>What house are you looking for?</Text>
        </Container>
        <Container>
          <PrimaryButton>Search</PrimaryButton>
        </Container>
      </SearchWrapper>
      >
    </Container>
  );
};

export default Houses;
